import React from 'react';
import web from "./images/restaurant-mockup1.png";
import { NavLink } from "react-router-dom";
import Common from './Common';

const Home = () => {
  return(
    <>
       <Common 
           name = 'Get pure Jain Food from' 
           vlog = 'We are Provide to you pure Jain Food...'
           imgsrc = {web}
           visit = "/Service" 
           btname = "Get Order"
       />
    </>
  )
};

export default Home;
